script: |
  super -f text -I q2312.spq | sort > q2312.out

inputs:
  - name: q2312.spq
    data: |
      SELECT DISTINCT + 92 AS col0 FROM tab0 (FORMAT parquet), tab1 (FORMAT parquet) AS cor0, tab2 (FORMAT parquet) cor1;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q2312.out
    data: |
      92
